> Political Donald Trump moving in on Bush, Rubio turf in Florida In this Oct. 21, 2015, photo, Republican presidential candidate Donald Trump speaks during a campaign stop at the Burlington Memorial Auditorium in Burlington, Iowa. Trump is getting ready to mount a major fight in Florida against two of the state’s resident sons. Jeb Bush led Florida as a two-term governor and Marco Rubio has been a senator since 2011. (AP Photo/Charlie Neibergall) 
